object.script:
function onTick() -- Read the touchscreen data from the script's composite input inputX = input.getNumber(3) inputY = input.getNumber(4) isPressed = input.getBool(1) Selection = input.getNumber(5) Gau = input.getNumber(6) Cluster = input.getNumber(7) Side = input.getNumber(8) FuelAir = input.getNumber(9) Ecm = input.getBool(10)
output.setBool(30, L) output.setBool(31, R) output.setBool(32, P)
-- Check if the player is pressing the rectangle at (10, 10) with width and height of 20px isPressingRectangleL = isPressed and isPointInRectangle(inputX, inputY, 0, h/2-3, 5, 7) isPressingRectangleR = isPressed and isPointInRectangle(inputX, inputY, w-5, h/2-3, 4, 7)
end
-- Returns true if the point (x, y) is inside the rectangle at (rectX, rectY) with width rectW and height rectH function isPointInRectangle(x, y, rectX, rectY, rectW, rectH) return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH end
function onDraw() w = screen.getWidth() h = screen.getHeight() screen.setColor(0, 50, 0)
-- Draw a rectangle that fills in when the player is pressing it if isPressingRectangleL then screen.drawRectF(0, h/2-3, 5, 7) L = true else screen.drawLine(4, h/2-3, 0, h/2+1) screen.drawLine(4, h/2+3, 0, h/2-1) L = false end if isPressingRectangleR then screen.drawRectF(w-5, h/2-3, 4, 7) R = true else screen.drawLine(w-4, h/2-3, w, h/2+1) screen.drawLine(w-4, h/2+3, w, h/2-1) R = false end
if Selection == 1 then screen.drawText(w/2-9, 2, "30mm") screen.drawText(w/2-14, 8, "Cannon") screen.drawText(w/2-9, h-17, math.floor(Gau)) screen.drawText(w/2-14, h-10, "/1350")
else if Selection == 2 then screen.drawText(w/2-12, 2, "300lb") screen.drawText(w/2-9, 8, "Bomb") screen.drawText(w/2-4, h-17, math.floor(Cluster)) screen.drawText(w/2-9, h-10, "/8")
else if Selection == 3 then screen.drawText(w/2-8, 2, "A2G") screen.drawText(w/2-14, 8, "Missile") screen.drawText(w/2-4, h-17, math.floor(Side)) screen.drawText(w/2-9, h-10, "/4")
else if Selection == 4 then screen.drawText(w/2-8, 2, "A2A") screen.drawText(w/2-9, 8, "Missile") screen.drawText(w/2-4, h-17, math.floor(FuelAir)) screen.drawText(w/2-9, h-10, "/2")
else if Selection == 5 and Ecm then screen.drawText(w/2-7, 2, "ECM") screen.drawText(w/2-7, 8, "Jam") screen.drawText(w/2-14, h-7, "Active")
else if Selection == 5 then screen.drawText(w/2-7, 2, "ECM") screen.drawText(w/2-7, 8, "Jam") screen.drawText(w/2-7, h-7, "OFF")
end end
end
end end
end
end
